--  DDL for Table CHANNELS
--------------------------------------------------------

  CREATE TABLE "CHANNELS" 
   (	"CHANNEL_CODE" VARCHAR(20), 
	"CHANNEL_DESC" VARCHAR(20), 
	"CHANNEL_CLASS" VARCHAR(20), 
	"INSERT_DT" DATE, 
	"LAST_UPDATE_DT" DATE,
	PRIMARY KEY (CHANNEL_CODE)
   ); 



